#include <bits/stdc++.h>using namespace std; void solve(){    // LOGIC    int n;    cin >> n;    unordered_map<int, int> m, c;      for(int i = 0;i < n;  i++){        int a ;        cin >> a ;         m[a]++;    }    c = m;     for(int i = 0; i <  n -1; i++){        int a;        cin >> a;        c[a]--;    }    for(auto i : c){        if(i.second != 0){            cout << i.first << endl;            m[i.first]--;        }    }     for(int i = 0; i < n - 2; i++){        int a;        cin >> a;        m[a]--;    }     for(auto i : m){        if(i.second != 0){            cout << i.first << endl;        }    }  } int main(){    ios::sync_with_stdio(false); // Fast I/O    cin.tie(nullptr);            // Untie cin from cout solve();}